import React from 'react';
import {Button, Form, Input, InputNumber, Row, Select, SelectProps, Statistic} from "antd";
import {Instrument} from "../../../shared/enumes";

export const Ticker: React.FC = () => {
    return (
        <Form style={{width: "30%"}}>
            <Form.Item>
                <h1>Ticker</h1>
            </Form.Item>
            <Form.Item>
                <Select
                    placeholder="Choose instrument"
                    options={(Object.keys(Instrument) as Array<keyof typeof Instrument>).map((key) => {
                        return {
                            value: key.toString(),
                            label: key.toString()
                        }
                    })}
                    onChange={() => {}}
                />
            </Form.Item>
            <Form.Item>
                <InputNumber
                    style={{width: "100%"}}
                    placeholder="Set amount"
                    onChange={() => {}}
                />
            </Form.Item>
            <Form.Item>
                <Row>
                    <Form
                        style={{width: "50%"}}
                    >
                        <Form.Item>
                            <Statistic
                                style={{alignContent: "center"}}
                                // title="Buy"
                                value={123}
                            />
                        </Form.Item>
                        <Form.Item>
                            <Button>Buy</Button>
                        </Form.Item>
                    </Form>
                    <Form
                        style={{width: "50%"}}
                    >
                        <Form.Item>
                            <Statistic
                                // title="Buy"
                                value={123}
                            />
                        </Form.Item>
                        <Form.Item>
                            <Button>Sell</Button>
                        </Form.Item>
                    </Form>
                </Row>
            </Form.Item>
        </Form>
    );
};
